import React from 'react';
import {useState} from "react";
import './index.css'

function Button(){

    const [count,setCount] = useState(0)

    function handleClick(){
        setCount(count+1)
    }

    return <div><button onClick={handleClick}  className='my-btn'>Click me</button>
    <p>{count}</p></div>
}

export default Button;
